import {Button, Container} from 'react-bootstrap'
import OurMission from '../components/OurMission'
import InterestedInJoining from '../components/InterestedInJoining'
import ObjectiveOfWebsite from '../components/ObjectiveOfWebsite'
import BottomNote from '../components/BottomNote'
const NotFoundPage = () => {
    return (
        <div style={{"backgroundImage": "linear-gradient(rgb(240,240,240), gray)", "minHeight": "85vh", "margin": "0 auto"}}>
            <h1>404: Page not found</h1>
            <Button onClick={()=> window.location.href='/'}>Go Home</Button>
        </div>
    )
}
